switch($in){
    case "index":
        $tbl = "gpb_activity_plugin_virtual_users";
        $where = " 1 ";
        if(!empty($_GPC['sex'])){
            $where .= " and sex='{$_GPC['sex']}'";
        }
        $index=isset($_GPC['page'])?$_GPC['page']:1;
        $pageIndex = $index;
        $pageSize = 50;
        $contion = 'limit '.($pageIndex-1) * $pageSize .','. $pageSize;
        $total= pdo_fetchcolumn('select count(*) from ' . tablename($tbl));
        $page = pagination($total,$pageIndex,$pageSize);
        //获取分页信息
        $sql = 'select * from '.tablename($tbl)."  order by uid desc ".$contion;
        $info = pdo_fetchall($sql);
        break;
    case "edit":
        $info = [];
        if($_GPC['submit'] == '提交'){
            $post = $_POST;
            if(empty($post['name'])){
                echo json_encode(['status'=>1,'msg'=>'昵称不能为空']);
                exit;
            }
//            if(empty($post['sex'])){
//                echo json_encode(['status'=>1,'msg'=>'请选择性别']);
//                exit;
//            }
            if(empty($post['head'])){
                echo json_encode(['status'=>1,'msg'=>'请选择头像']);
                exit;
            }
            unset($post['submit']);
            $data = [
                'name'=>$post['name'],
//                'sex'=>$post['sex'],
                'phone'=>$post['phone'],
                'head'=>$post['head'],
//                'aid'=>$post['aid'],
            ];
            if(!empty($post['uid'])){
                //修改
                $res = pdo_update("gpb_activity_plugin_virtual_users",$data,array('uid'=>$post['uid']));
            }else{
                //新增
                $res = pdo_insert('gpb_activity_plugin_virtual_users', $data);
            }
            echo $res?json_encode(['status'=>0,'msg'=>'保存成功']):json_encode(['status'=>1,'msg'=>'保存失败']);
            exit;
        }else{
            $act = '新增';
            if(!empty($_GPC['uid'])){
                $info = pdo_get("gpb_activity_plugin_virtual_users",array('uid'=>$_GPC['uid']));
                $act = '编辑';
            }
        }

        break;
    case "delete":
        $uid = !empty($_GET['uid'])?$_GET['uid']:$_GPC['uid'];
        if(empty($uid) || $uid<1){
            echo json_encode(['status'=>1,'msg'=>'参数错误']);exit;
        }
        $res = pdo_delete("gpb_activity_plugin_virtual_users",array("uid"=>$uid));
        if($res){
            echo json_encode(['status'=>0,'msg'=>'删除成功']);exit;
        }else{
            echo json_encode(['status'=>1,'msg'=>'删除失败']);exit;
        }
